const Contactlist = (id) => {
  console.log(id);
  const render = id.map((contact) =>{
    return(
      <div>
        {id.name}
        <div>
        {id.email}
      </div>
      </div>

    )
  })
  return (
    <div className="ui celled list">
      <h2>ContactList</h2>
    </div>
  )
}

export default Contactlist
